    return(
        <div className='result-container'>
          <div className='result-msg'>{gameResult}</div>

          <div className='choice-container'>
            <p className='choice-moves'>Player: {myChoice}</p>
            <p className='choice-moves'>Computer: {houseChoice}</p>
          </div>
        </div>
      )
}
